/// status : 1
/// msg : ""

class JudgeModel {
  JudgeModel({
      this.judgeName, 
      this.status, 
      this.msg,});

  JudgeModel.fromJson(dynamic json) {
    if (json['judge_name'] == null || json['judge_name'] == "") {
      print("NO Judgment Found");
    }
    else {
      judgeName = [];
      json['judge_name'].forEach((v) {
        judgeName.add(Judge_name.fromJson(v));
      });
    }
    status = json['status'];
    msg = json['msg'];
  }
  List<Judge_name> judgeName;
  int status;
  String msg;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (judgeName != null) {
      map['judge_name'] = judgeName.map((v) => v.toJson()).toList();
    }
    map['status'] = status;
    map['msg'] = msg;
    return map;
  }

}

